//*****************************************************************************
//
//! @brief
//! @param pDevHandle
//! @param msgs
//! @param num
//!
//! @return uint32_t
//
//*****************************************************************************
static uint32_t
chsc5816_master_xfer_with_end(void *pDevHandle, struct rt_i2c_msg          *msgs, rt_uint32_t num)
{
    struct rt_i2c_msg *msg;
    int i;
    rt_uint32_t msg_len = 0;

    for (i = 0; i < num; i++)
    {
        msg = &msgs[i];

        if (msg->flags == AM_DEVICES_CHSC5816_I2C_RD)
        {
            chsc5816_i2c_read(pDevHandle, msg->addr, (uint32_t *)msg->buf, msg->len);
            msg_len += msg->len;
        }
        else if ( msg->flags == AM_DEVICES_CHSC5816_I2C_WR )
        {
            chsc5816_i2c_write_with_end(pDevHandle, msg->addr, (uint32_t *)msg->buf, msg->len);
            msg_len += (msg->len - 1);
        }
    }

    return msg_len;
}

