//*****************************************************************************
//
//! @brief semi_touch_read_bytes function
//! @param pDevHandle - Device handle
//! @param reg - register address, must 4B aligned
//! @param buffer - data buffer
//! @param len - data length, must 4B aligned
//!
//! @return 0 - pass
//!    others - fail
//
//*****************************************************************************
int32_t
semi_touch_read_bytes(void *pDevHandle, uint32_t reg, uint8_t* buffer, uint16_t len)
{
    int32_t ret = SEMI_DRV_ERR_OK;
    uint16_t once;
    uint32_t retry;

    while ( len > 0 )
    {
        once = (len>MAX_IO_BUFFER_LEN)?MAX_IO_BUFFER_LEN:len;

        ret = -1;
        for ( retry = 0; retry < 3; retry++ )
        {
            if ( semi_i2c_read_bytes(pDevHandle, reg, buffer, once) == SEMI_DRV_ERR_OK )
            {
                ret = SEMI_DRV_ERR_OK;
                break;
            }
        }

        if ( ret != SEMI_DRV_ERR_OK )
        {
            break;
        }

        reg    += once;
        buffer += once;
        len    -= once;
    }

    return ret;
}

//*****************************************************************************
//
//! @brief - semi_touch_write_bytes function
//! @param pDevHandle - Device handle
//! @param reg - register address, must 4B aligned
//! @param buffer - data buffer
//! @param len - data length, must 4B aligned
//!
//! @return 0 - pass
//!    others - fail
//
//*****************************************************************************
int32_t
semi_touch_write_bytes(void *pDevHandle, uint32_t reg, uint8_t* buffer, uint16_t len)
{
    int32_t ret = SEMI_DRV_ERR_OK;
    uint16_t once;
    uint32_t k, retry;
    uint8_t writeBuff[MAX_IO_BUFFER_LEN];

    while ( len > 0 )
    {
        once = (len < (MAX_IO_BUFFER_LEN - 4)) ? len : (MAX_IO_BUFFER_LEN - 4);

        //
        // write address into iic device controller
        //
        writeBuff[0] = (uint8_t)(reg >> 24);
        writeBuff[1] = (uint8_t)(reg >> 16);
        writeBuff[2] = (uint8_t)(reg >> 8);
        writeBuff[3] = (uint8_t)(reg);
        for ( k = 0; k < once; k++ )
        {
            //
            // write from beginning of 4 bytes
            //
            writeBuff[k + 4] = buffer[k];
        }

        ret = -1;
        for ( retry = 0; retry < 3; retry++ )
        {
            if ( semi_touch_iic_write(pDevHandle, reg, writeBuff, once + 4) == SEMI_DRV_ERR_OK )
            {
                ret = SEMI_DRV_ERR_OK;
                break;
            }
        }
        if ( ret != SEMI_DRV_ERR_OK )
        {
            break;
        }

        reg    += once;
        buffer += once;
        len    -= once;
    }

    return ret;
}

//*****************************************************************************
//
//! @brief - semi_touch_write_bytes_with_end function
//! @param pDevHandle - Device handle
//! @param reg - register address, must 4B aligned
//! @param buffer - data buffer
//! @param len - data length, must 4B aligned
//!
//! @return 0 - pass
//!    others - fail
//
//*****************************************************************************
int32_t
semi_touch_write_bytes_with_end(void *pDevHandle, uint32_t reg, uint8_t* buffer, uint16_t len)
{
    int32_t ret = SEMI_DRV_ERR_OK;
    uint16_t once;
    uint32_t k, retry;
    uint8_t writeBuff[MAX_IO_BUFFER_LEN];

    while ( len > 0 )
    {
        once = (len < (MAX_IO_BUFFER_LEN - 4)) ? len : (MAX_IO_BUFFER_LEN - 4);
        writeBuff[0] = (uint8_t)(reg >> 24);
        writeBuff[1] = (uint8_t)(reg >> 16);
        writeBuff[2] = (uint8_t)(reg >> 8);
        writeBuff[3] = (uint8_t)(reg);
        for ( k = 0; k < once; k++ )
        {
            writeBuff[k + 4] = buffer[k];
        }

        ret = -1;
        for ( retry = 0; retry < 3; retry++ )
        {
            if ( chsc5816_write_with_end(pDevHandle, reg, writeBuff, once + 4) == SEMI_DRV_ERR_OK )
            {
                ret = SEMI_DRV_ERR_OK;
                break;
            }
        }
        if ( ret != SEMI_DRV_ERR_OK )
        {
            break;
        }

        reg    += once;
        buffer += once;
        len    -= once;
    }

    return ret;
}

//*****************************************************************************
//
//! @brief - semi_touch_update function
//! @param pDevHandle - Device handle
//! @param pdata - register address
//! @param len - data length
//!
//! @return 0 - pass
//!    others - fail
//
//*****************************************************************************
static int32_t
semi_touch_update(void *pDevHandle, uint8_t *pdata, uint32_t len)
{
    if ( (pdata == NULL) || (len<1024) || (len > 0x9f00))
    {
        PRINT_DBG("chsc:semi_touch_update, not chsc5816 fw len err fn");
        return -1;
    }

    if ( (pdata[0x30] != 0x16) || (pdata[0x31] != 0x58) )
    {
        PRINT_DBG("chsc:semi_touch_update, not chsc5816 fw\n");
        return -1;
    }

    if ( semi_touch_enter_burn_mode(pDevHandle) != 0 )
    {
        //kal_prompt_trace(MOD_WAP,"chsc::semi_touch_enter_burn_mode fail\n");
        return -1;
    }

    //
    // erase need about 1.3 s
    //
    if ( semi_touch_burn_erase(pDevHandle) != 0 )
    {
        PRINT_DBG("chsc::semi_touch_burn_erase fail\n");
        return -1;
    }

    //
    // start write the firmware, start from 28th bytes
    //
    if ( semi_touch_nvm_write(pDevHandle, pdata, 0x00000000, len) != 0 )
    {
        PRINT_DBG("chsc::semi_touch_nvm_write fail\n");
        return -1;
    }

    return SEMI_DRV_ERR_OK;
}

//*****************************************************************************
//
//! @brief - semi_touch_enter_burn_mode function
//!
//! @return 0 - pass
//!    others - fail
//
//*****************************************************************************
static int32_t
semi_touch_enter_burn_mode(void *pDevHandle)
{
    struct m_ctp_cmd_std_t cmd_send_tp;
    struct m_ctp_rsp_std_t ack_from_tp;
    ack_from_tp.d0 = 0;
    cmd_send_tp.id = CMD_IDENTITY;
    cmd_send_to_tp(pDevHandle, &cmd_send_tp, &ack_from_tp, 20, 5);
    if ( (ack_from_tp.d0 == 0xE9A2) && (ack_from_tp.d1 == 0x165d) )
    {
        return SEMI_DRV_ERR_OK;
    }

    if ( semi_touch_run_ram_code(pDevHandle, fw_5816_burn, sizeof(fw_5816_burn)) != 0 )
    {
        return -1;
    }

    cmd_send_tp.id = CMD_IDENTITY;

    //
    // after write, read for verification
    //
    if ( cmd_send_to_tp(pDevHandle, &cmd_send_tp, &ack_from_tp, 20, 5) != 0 )
    {
        return -1;
    }
    if ( (ack_from_tp.d0 == 0xE9A2) && (ack_from_tp.d1 == 0x165d) )
    {
        return SEMI_DRV_ERR_OK;
    }
    return -SEMI_DRV_ERR_HAL_IO;
}

//*****************************************************************************
//
//! @brief - cmd_send_to_tp function
//! @param pDevHandle - Device handle
//! @param ptr_cmd
//! @param ptr_rsp
//! @param once_delay
//! @param poolgap
//!
//! @return 0 - pass
//!    others - fail
//
//*****************************************************************************
static int32_t
cmd_send_to_tp(void *pDevHandle,
               struct m_ctp_cmd_std_t *ptr_cmd,
               struct m_ctp_rsp_std_t *ptr_rsp,
               int32_t once_delay,
               int32_t poolgap)
{
    int32_t ret = -SEMI_DRV_ERR_HAL_IO;
    uint32_t retry = 0;
    uint32_t cmd_rsp_ok = 0;

    ptr_cmd->tag = 0xE9;
    ptr_cmd->chk = 1 + ~caculate_checksum_u16((uint16_t*)&ptr_cmd->d0, sizeof(struct m_ctp_cmd_std_t) - 2);
    ret = semi_touch_write_bytes_with_end(pDevHandle, 0x20000000, (uint8_t*)ptr_cmd, sizeof(struct m_ctp_cmd_std_t));
    if ( ret != 0)  // TODO: need confirm!!!
    {
        return -1;
    }

    semi_touch_msdelay(once_delay);
    while ( retry++ < 20 )
    {
        semi_touch_msdelay(poolgap);
        ret = semi_touch_read_bytes(pDevHandle, 0x20000000, (uint8_t*)ptr_rsp, sizeof(struct m_ctp_rsp_std_t));
        if ( ret != 0 )     // TODO: need confirm!!!
        {
            return -1;
        }

        if ( ptr_cmd->id != ptr_rsp->id )
        {
            continue;
        }

        if ( !caculate_checksum_u16((uint16_t*)ptr_rsp, sizeof(struct m_ctp_rsp_std_t)) )
        {
            if ( 0 == ptr_rsp->cc )     //success
            {
                cmd_rsp_ok = 1;
            }
            break;
        }
    }

    ret = -1;
    if ( cmd_rsp_ok == 1 )
    {
        ret = SEMI_DRV_ERR_OK;
    }

    return ret;
}

//*****************************************************************************
//
//! @brief - semi_touch_run_ram_code function
//! @param pDevHandle - Device handle
//! @param bin_code
//! @param len
//!
//! @return 0 - pass
//!    others - fail
//
//*****************************************************************************
static int32_t
semi_touch_run_ram_code(void *pDevHandle, const uint8_t* bin_code, uint16_t len)
{
    int32_t retry;
    int32_t ret = 0, reg_value = 0;

    for ( retry = 0; retry < 5; retry++ )
    {
        //reset mcu
        semi_touch_reset(pDevHandle);
        //hold mcu
        reg_value = 0x12044000;
        ret = semi_touch_write_bytes_with_end(pDevHandle, 0x40007000, (uint8_t*)&reg_value, 4);
        if ( ret != 0 )
        {
            continue;
        }
        //open auto feed
        reg_value = 0x0000925a;
        ret = semi_touch_write_bytes_with_end(pDevHandle, 0x40007010, (uint8_t*)&reg_value, 4);
        if ( ret != 0 )
        {
            continue;
        }

        //run ramcode
        ret = semi_touch_write_and_check(pDevHandle, 0x20000000, (uint8_t* )bin_code, len);
        if ( ret != 0 )
        {
            continue;
        }
        break;
    }

    if ( ret != 0 )
    {
        return -1;
    }

    //remap
    reg_value = 0x12044002;
    ret = semi_touch_write_bytes_with_end(pDevHandle, 0x40007000, (uint8_t*)&reg_value, 4);
    if ( ret != 0 )
    {
        return -1;
    }

    //release mcu
    reg_value = 0x12044003;
    ret = semi_touch_write_bytes_with_end(pDevHandle, 0x40007000, (uint8_t*)&reg_value, 4);
    if ( ret != 0 )
    {
        return -1;
    }

    semi_touch_msdelay(30);

    return 0;
}

//*****************************************************************************
//
//! @brief - semi_touch_reset function
//!
//! @return 0 - pass
//!    others - fail
//
//*****************************************************************************
static void
semi_touch_reset(void *pDevHandle)
{
    am_devices_iom_gpio_chsc5816_t *pChsc = (am_devices_iom_gpio_chsc5816_t*)pDevHandle;
    am_hal_gpio_output_clear(pChsc->ui32RstPinNum);
    am_util_delay_ms(3);
    am_hal_gpio_output_set(pChsc->ui32RstPinNum);
    am_util_delay_ms(5);
}

//*****************************************************************************
//
//! @brief - semi_touch_write_and_check function
//!
//! @return 0 - pass
//!    others - fail
//
//*****************************************************************************
static int32_t
semi_touch_write_and_check(void *pDevHandle, uint32_t addr, uint8_t* buffer, uint16_t len)
{
    int32_t ret = 0, once = 0, index = 0, retry = 0;
    uint8_t cmp_buffer[MAX_IO_BUFFER_LEN - 4];

    while ( len > 0 )
    {
        retry = 0;
        do
        {
            ret = SEMI_DRV_ERR_OK;
            once = (len<(MAX_IO_BUFFER_LEN-4))?len:(MAX_IO_BUFFER_LEN-4);
            ret = semi_touch_write_bytes_with_end(pDevHandle, addr, buffer, once);
            ret = semi_touch_read_bytes(pDevHandle, addr, cmp_buffer, once);
            for ( index = 0; index < once; index++ )
            {
                if ( cmp_buffer[index] != buffer[index] )
                {
                    ret = -SEMI_DRV_ERR_CHECKSUM;
                    break;
                }
            }
            if ( SEMI_DRV_ERR_OK == ret )
            {
                break;
            }
        } while ( ++retry < 3 );

        if ( SEMI_DRV_ERR_OK != ret )
        {
            break;
        }

        addr   += once;
        buffer += once;
        len    -= once;
    }

    return ret;
}

//*****************************************************************************
//
//! @brief - semi_touch_burn_erase function
//!
//! @return 0 - pass
//!    others - fail
//
//*****************************************************************************
static int32_t
semi_touch_burn_erase(void *pDevHandle)
{
    struct m_ctp_cmd_std_t cmd_send_tp;
    struct m_ctp_rsp_std_t ack_from_tp;
    cmd_send_tp.id = CMD_FLASH_ERASE;
    cmd_send_tp.d0 = 0x01;
    return cmd_send_to_tp(pDevHandle, &cmd_send_tp, &ack_from_tp, 1000, 40);
}

//*****************************************************************************
//
//! @brief semi_touch_nvm_write function
//! @param pDevHandle - Device handle
//! @param psrc - pointer to the source
//! @param addr - address
//! @param len - data length
//!
//! @return 0 - pass
//!    others - fail
//
//*****************************************************************************
static int32_t
semi_touch_nvm_write(void *pDevHandle, uint8_t *psrc, uint32_t adr, uint32_t len)
{
    int32_t ret = -1;
    uint32_t left = len;
    uint32_t retry, combChk;
    struct m_ctp_cmd_std_t cmd_send_tp;
    struct m_ctp_rsp_std_t ack_from_tp;

    cmd_send_tp.id = CMD_MEM_WR;

    while (left)
    {
        len = (left > 1024) ? 1024 : left;
        combChk = caculate_checksum_ex(psrc, len);

        cmd_send_tp.d0 = adr & 0xffff;    /* addrss space[0,64K)  */
        cmd_send_tp.d1 = len;
        cmd_send_tp.d3 = NVM_W;
        cmd_send_tp.d2 = (uint16_t) combChk;
        cmd_send_tp.d4 = (uint16_t) (combChk >> 16);
        cmd_send_tp.d5 = (adr >> 16) & 0xffff;

        retry = 0;
        while (++retry <= 3)
        {
            ret = semi_touch_write_bytes_with_end(pDevHandle, TP_WR_BUFF_ADDR, psrc, len);
            if ( SEMI_DRV_ERR_OK != ret )
            {
                continue;
            }

            ack_from_tp.id = CMD_NA;
            ret = cmd_send_to_tp(pDevHandle, &cmd_send_tp, &ack_from_tp, 200, 20);
            if ( SEMI_DRV_ERR_OK != ret )
            {
                continue;
            }

            break;
        }

        left -= len;
        adr  += len;
        psrc += len;
        if ( ret != SEMI_DRV_ERR_OK )
        {
            break;
        }
    }

    return ret;
}

//*****************************************************************************
//
//! @brief - semi_touch_dect function
//!
//! @return 0 - pass
//!    others - fail
//
//*****************************************************************************
static int32_t
semi_touch_dect(void *pDevHandle)
{
    uint32_t u32Data, retry;

    for ( retry = 0; retry < 3; retry++ )
    {
        semi_touch_reset(pDevHandle);

        if ( !semi_touch_read_bytes(pDevHandle, 0x20000000, (uint8_t *)&u32Data, 4) )
        {
            return 0;
        }
    }
    return -1;
}

//*****************************************************************************
//
//! @brief - semi_touch_setup_check function
//!
//! @return 0 - pass
//!    others - fail
//
//*****************************************************************************
static void
semi_touch_setup_check(void *pDevHandle)
{
    int32_t retry = 0;
    uint32_t naFlag = 0;
    img_header_t image_header;
    img_header_t image_confirm;
    semi_touch_write_bytes_with_end(pDevHandle, 0x20000018, (uint8_t*)&naFlag, 4);  //clean boot status
    semi_touch_reset(pDevHandle);
    st_dev.fw_ver    = 0;
    st_dev.vid_pid   = 0;
    st_dev.setup_ok  = 0;
    image_header.sig = 0;

    //
    // firmware works properly after 80ms power up
    //
    for ( retry = 0; retry < 10; retry++ )
    {
        semi_touch_msdelay(10);
        if ( semi_touch_read_bytes(pDevHandle, 0x20000014, (uint8_t*)&image_header, sizeof(image_header)) != 0 )
        {
            continue;
        }
        if ( semi_touch_read_bytes(pDevHandle, 0x20000014, (uint8_t*)&image_confirm, sizeof(image_confirm)) != 0 )
        {
            continue;
        }
        if ( (image_header.sig != image_confirm.sig)                ||
             (image_header.vid_pid != image_confirm.vid_pid)        ||
             (image_header.raw_offet != image_confirm.raw_offet)    ||
             (image_header.dif_offet != image_confirm.dif_offet)    ||
             (image_header.fw_ver != image_confirm.fw_ver))
        {
            //kal_prompt_trace(MOD_WAP,"chsc::double check, retry\n");
            continue;
        }
        if ( image_header.sig == 0x43534843 )
        {
            st_dev.fw_ver   = image_header.fw_ver;
            st_dev.vid_pid  = image_header.vid_pid;
            st_dev.raw_adr  = image_confirm.raw_offet + 0x20000000;
            st_dev.setup_ok = 1;
            st_dev.ctp_status = CTP_POINTING_WORK;
            break;
        }
        else if ( image_header.sig == 0x4F525245 )  //boot self check fail
        {
            break;
        }
    }

    return;
}

//*****************************************************************************
//
//! @brief - semi_touch_nvm_read function
//!
//! @return 0 - pass
//!    others - fail
//
//*****************************************************************************
static int32_t
semi_touch_nvm_read(void *pDevHandle, uint8_t *pdes, uint32_t adr, uint32_t len)
{
    int32_t ret = -1;
    uint32_t left = len;
    uint32_t local_check, retry;
    struct m_ctp_cmd_std_t cmd_send_tp;
    struct m_ctp_rsp_std_t ack_from_tp;

    cmd_send_tp.id = CMD_MEM_RD;

    while (left)
    {
        len = (left > 1024) ? 1024 : left;

        cmd_send_tp.d0 = adr & 0xffff;
        cmd_send_tp.d1 = len;
        cmd_send_tp.d2 = 0;
        cmd_send_tp.d3 = NVM_R;
        cmd_send_tp.d5 = (adr >> 16) & 0xffff;

        retry = 0;
        while (retry++ < 3)
        {
            ack_from_tp.id = CMD_NA;
            ret = cmd_send_to_tp(pDevHandle, &cmd_send_tp, &ack_from_tp, 20, 10);
            if ( SEMI_DRV_ERR_OK != ret )
            {
                continue;
            }

            semi_touch_read_bytes(pDevHandle, TP_RD_BUFF_ADDR, pdes, len);

            local_check = caculate_checksum_ex(pdes, len);
            if ((ack_from_tp.d0 != (uint16_t)local_check) ||
                (ack_from_tp.d1 != (uint16_t)(local_check >> 16)))
            {
                ret = -SEMI_DRV_ERR_CHECKSUM;
                continue;
            }
            break;
        }

        adr  += len;
        left -= len;
        pdes += len;
        if ( ret != SEMI_DRV_ERR_OK )
        {
            break;
        }
    }

    return ret;
}

//*****************************************************************************
//
//! @brief semi_get_backup_pid function
//! @param id - pointer to the id
//!
//! @return 0 - pass
//!    others - fail
//
//*****************************************************************************
static int32_t
semi_get_backup_pid(void *pDevHandle, uint32_t *id)
{
    st_dev.ctp_status = CTP_UPGRAD_RUNING;

    if ( semi_touch_enter_burn_mode(pDevHandle) != SEMI_DRV_ERR_OK )
    {
        return -1;
    }

    return semi_touch_nvm_read(pDevHandle, (uint8_t *)id, VID_PID_BACKUP_ADDR, 4);
}

//*****************************************************************************
//
//! @brief - semi_touch_update_check function
//!
//! @return 0 - pass
//!    others - fail
//
//*****************************************************************************
static int32_t
semi_touch_update_check(void *pDevHandle)
{
    uint32_t pvid;
    uint8_t * pfw;
    uint32_t * plist;
    int32_t k, idx_active;
    uint16_t upd_boot_ver = 0;
    struct chsc_updfile_header *upd_header;
    st_dev.needUpd = 0;
    st_dev.updPdata = 0;
    st_dev.newBootLen = 0;
    if ( st_dev.setup_ok == 0 )
    {
        if ( semi_get_backup_pid(pDevHandle, &pvid) == 0 )
        {
            st_dev.vid_pid = pvid;
        }
    }
    if ( (uint32_t)chsc_upd_data & 3 )
    {
        PRINT_DBG("chsc::illegal memory buffer, must 4B aliged\n");
        return -SEMI_DRV_INVALID_PARAM;
    }
    upd_header = (struct chsc_updfile_header *)chsc_upd_data;
    if ( (upd_header->sig != 0x43534843) || (upd_header->n_match == 0) )
    {
        PRINT_DBG("chsc::illegal upd_header-sig\n");
        return -SEMI_DRV_ERR_NOT_MATCH;
    }

    if ( (upd_header->len_boot <= 15 * 1024) || (upd_header->len_boot >= 40 * 1024) )
    {
        PRINT_DBG("chsc::illegal boot-len\n");
        return -SEMI_DRV_ERR_NOT_MATCH;
    }
    plist = (uint32_t *)((uint8_t *)chsc_upd_data + sizeof(struct chsc_updfile_header));
    pfw   = (uint8_t *)plist + (upd_header->n_match*4) + upd_header->len_cfg;

    if ( (pfw[0x30] != 0x16) || (pfw[0x31] != 0x58) )
    {
        PRINT_DBG("chsc:no chsc5816 fw found\n");
        return -SEMI_DRV_ERR_NOT_MATCH;
    }
    st_dev.updPdata = pfw;
    st_dev.newBootLen = upd_header->len_boot;
    idx_active = -1;
    upd_boot_ver = (pfw[0x3f] << 8) + pfw[0x3e];
    for ( k = 0; k < upd_header->n_match; k++ )
    {
        pvid = plist[k];
        PRINT_DBG("chsc::pid_vid in list=0x%x\n", pvid);
        if ( (pvid & PID_VID_MASK) == (st_dev.vid_pid & PID_VID_MASK) )
        {
            PRINT_DBG("chsc::running_ver=%d,  upd_ver=%d\n", st_dev.fw_ver, upd_boot_ver);
            if ( (st_dev.fw_ver < upd_boot_ver) || (st_dev.setup_ok == 0) )
            {
                idx_active = k;
            }
            break;
        }
    }
    if ( (st_dev.setup_ok == 0) && (idx_active < 0) )
    {
        idx_active = 0;
    }

    if ( idx_active >= 0 )
    {
        st_dev.needUpd = 1;
    }
    return SEMI_DRV_ERR_OK;
}

//*****************************************************************************
//
//! @brief - semi_touch_init function
//!
//! @return 0 - pass
//!    others - fail
//
//*****************************************************************************
int32_t
semi_touch_init(void *pDevHandle)
{
    semi_touch_reset(pDevHandle);
    if ( semi_touch_dect(pDevHandle) != SEMI_DRV_ERR_OK )
    {
        PRINT_DBG("chsc:no chsc5816\r\n" );
        return -1;
    }
    semi_touch_setup_check(pDevHandle);
    semi_touch_update_check(pDevHandle);
//    if ( st_dev.needUpd )
//    {
        semi_touch_update(pDevHandle, st_dev.updPdata, st_dev.newBootLen);
        semi_touch_setup_check(pDevHandle);
//    }
    semi_touch_reset(pDevHandle);
    st_dev.ctp_status = CTP_POINTING_WORK;
    return 0;
}

int32_t
am_devices_chsc5816_fw_update(void *pDevHandle, uint8_t fw_ver)
{
    static uint8_t ui8_runOnce = 0;
    if (ui8_runOnce == 0)
    {
        img_header_t sTestImgHeader;
        chsc5816_read(pDevHandle, 0x20000014, (uint8_t *)&sTestImgHeader, 16);
        PRINT_DBG("CHSC5816 touch firmware version is %d\n", sTestImgHeader.fw_ver);

        if (fw_ver == 4)
        {
            chsc_upd_data = chsc_upd_data_v04;
        }
        else if (fw_ver == 3)
        {
            chsc_upd_data = chsc_upd_data_v03;
        }
        else
        {
            PRINT_DBG("CHSC5816 firmware version not supported\n");
            return -1;
        }

        semi_touch_init(pDevHandle);
    }

    return 0;
}

